import React from 'react';
import {
    Form,
    FormGroup,
    Input,
    Label,
    Container,
    Button
}from 'reactstrap';

export const Forms =()=>{
    return(
        <Container>
            <Form>
                <FormGroup>
                    <Label>Name</Label>
                    <Input type="text" name="name" />
                </FormGroup>
                <FormGroup>
                    <Label>Contact</Label>
                    <Input type="text" name="contact"/>
                </FormGroup>
            </Form>
        </Container>        
    )
}
